TH1F*
EmJetHistos::Get1D(string name)
{
  int index = GetHistoIndex(name);
  assert(vector_hist1d.size()>index); // Make sure index exists first
  auto histPointer = vector_hist1d[index];
  assert(histPointer);
}

TH2F*
EmJetHistos::Get2D(string name)
{
  int index = GetHistoIndex(name);
  assert(vector_hist2d.size()>index); // Make sure index exists first
  auto histPointer = vector_hist2d[index];
  assert(histPointer);
}

void
EmJetHistos::fillToVector()
{
  vector_hist1d.reserve(hist1d.size());
  for (const auto & kv : hist1d) {
    string name = kv.first;
    auto histPointer = kv.second;
    assert( histPointer ); // Make sure pointer is not null
    assert( vector_hist1d.size() == GetHistoIndex(name) ); // Make sure histogram index is correct
    vector_hist1d.push_back(histPointer);
  }

  vector_hist2d.reserve(hist2d.size());
  for (const auto & kv : hist2d) {
    string name = kv.first;
    auto histPointer = kv.second;
    assert( histPointer ); // Make sure pointer is not null
    assert( vector_hist2d.size() == GetHistoIndex(name) ); // Make sure histogram index is correct
    vector_hist2d.push_back(histPointer);
  }
}
